import React from "react";  
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import './navigation.css'

const Navigation = () =>{
    return(
        <Navbar bg="light" expand="lg" id={'navbar1'}>
        <Container>
          <Navbar.Brand href="#home">
            <img src="https://o.remove.bg/downloads/cb06de0a-c6fb-4cc3-ad06-671b59ba50fe/wazirx-logo-blue.8f74de7a-removebg-preview.png" className="d-inline-block align-top" width={'150px'}/>
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ms-auto">
              <Nav.Link href="#home" className='text-center' id={'btn1'}>EXCHANGE</Nav.Link>
              <Nav.Link href="#link" className='text-center' id={'btn2'}>P2P</Nav.Link>
              <Nav.Link href="#link" className='text-center' id={'btn3'}>LOG IN</Nav.Link>
              <Nav.Link href="#link" className='text-center' id={'btn4'}>SIGN UP</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    )
}

export default Navigation
